Many websites such as GitHub put parameters in their URL. For example, https://github.com/DioxusLabs utilizes the text after the domain to dynamically search and display content about an organization. We want to store our blogs in a database and load them as needed. We also want our users to be able to send people a link to a specific blog post. Instead of listing all of the blog titles at compile time, we can make a dynamic route. We could utilize a search page that loads a blog when clicked but then our users won't be able to share our blogs easily. This is where URL parameters come in. The path to our blog will look like /blog/myBlogPage, myBlogPage being the URL parameter. First, let's create a layout component (similar to the navbar) that wraps the blog content. This allows us to add a heading that tells the user they are on the blog. #[inline_props]
fn Blog(cx: Scope) -> Element { render! { h1 { "Blog" } Outlet::<Route> {} }
} Now we'll create another index component, that'll be displayed when no blog post is selected: #[inline_props]
fn BlogList(cx: Scope) -> Element { render! { h2 { "Choose a post" } ul { li { Link { to: Route::BlogPost { name: "Blog post 1".into() }, "Read the first blog post" } } li { Link { to: Route::BlogPost { name: "Blog post 2".into() }, "Read the second blog post" } } } }
} We also need to create a component that displays an actual blog post. This component will accept the URL parameters as props: // The name prop comes from the /:name route segment
#[inline_props]
fn BlogPost(cx: Scope, name: String) -> Element { render! { h2 { "Blog Post: {name}"} }
} Finally, let's tell our router about those components: #[derive(Routable, Clone)]
#[rustfmt::skip]
enum Route { #[layout(NavBar)] #[route("/")] Home {}, #[nest("/blog")] #[layout(Blog)] #[route("/")] BlogList {}, #[route("/blog/:name")] BlogPost { name: String }, #[end_layout] #[end_nest] #[end_layout] #[route("/:..route")] PageNotFound { route: Vec<String>, },
} That's it! If you head to /blog/1 you should see our sample post.

