When developing bigger applications we often want to nest routes within each other. As an example, we might want to organize a settings menu using this pattern: └ Settings ├ General Settings (displayed when opening the settings) ├ Change Password └ Privacy Settings We might want to map this structure to these paths and components: /settings -> Settings { GeneralSettings }
/settings/password -> Settings { PWSettings }
/settings/privacy -> Settings { PrivacySettings } Nested routes allow us to do this without repeating /settings in every route.

