Layouts allow you to wrap all child routes in a component. This can be useful when creating something like a header that will be used in many different routes. [Outlet] tells the router where to render content in layouts. In the following example, the Index will be rendered within the [Outlet]. #[derive(Routable, Clone)]
#[rustfmt::skip]
enum Route { #[layout(Wrapper)] #[route("/")] Index {},
} #[inline_props]
fn Wrapper(cx: Scope) -> Element { render! { header { "header" } // The index route will be rendered here Outlet::<Route> { } footer { "footer" } }
} #[inline_props]
fn Index(cx: Scope) -> Element { render! { h1 { "Index" } }
} The example above will output the following HTML (line breaks added for readability): <header>header</header>
<h1>Index</h1>
<footer>footer</footer>

