We can get a navigator with the [use_navigator] hook. This hook returns a [Navigator]. We can use the [Navigator] to trigger four different kinds of navigation: push will navigate to the target. It works like a regular anchor tag. replace works like push, except that it replaces the current history entry instead of adding a new one. This means the prior page cannot be restored with the browser's back button. Go back works like the browser's back button. Go forward works like the browser's forward button. #[inline_props]
fn Home(cx: Scope) -> Element { let nav = use_navigator(cx); // push nav.push(Route::PageNotFound { route: vec![] }); // replace nav.replace(Route::Home {}); // go back nav.go_back(); // go forward nav.go_forward(); render! { h1 { "Welcome to the Dioxus Blog!" } }
} You might have noticed that, like [Link], the [Navigator]s push and replace functions take a [NavigationTarget]. This means we can use either [Internal], or [External] targets.

