We want to use Dioxus Router to separate our application into different "pages". Dioxus Router will then determine which page to render based on the URL path. To start using Dioxus Router, we need to use the [Routable] macro. The [Routable] macro takes an enum with all of the possible routes in our application. Each variant of the enum represents a route and must be annotated with the [route(path)] attribute. #![allow(non_snake_case)]
use dioxus::prelude::*;
use dioxus_router::prelude::*; /// An enum of all of the possible routes in the app.
#[derive(Routable, Clone)]
enum Route { // The home page is at the / route #[route("/")] // If the name of the component and variant are the same you can omit the component and props name // If they are different you can specify them like this: // #[route("/", ComponentName, PropsName)] Home {},
} All other hooks and components the router provides can only be used as a descendant of a [Router] component. If you head to your application's browser tab, you should now see the text Welcome to Dioxus Blog! when on the root URL (http://localhost:8080/). If you enter a different path for the URL, nothing should be displayed. This is because we told Dioxus Router to render the Home component only when the URL path is /.

