In our example, when a route doesn't exist Dioxus Router doesn't render anything. Many sites also have a "404" page when a path does not exist. Let's add one to our site. First, we create a new PageNotFound component. #[inline_props]
fn PageNotFound(cx: Scope, route: Vec<String>) -> Element { render! { h1 { "Page not found" } p { "We are terribly sorry, but the page you requested doesn't exist." } pre { color: "red", "log:\nattemped to navigate to: {route:?}" } }
} Next, register the route in the Route enum to match if all other routes fail. #[derive(Routable, Clone)]
enum Route { #[route("/")] Home {}, // PageNotFound is a catch all route that will match any route and placing the matched segments in the route field #[route("/:..route")] PageNotFound { route: Vec<String> },
} Now when you go to a route that doesn't exist, you should see the page not found text.

