Our site visitors won't know all the available pages and blogs on our site so we should provide a navigation bar for them. Our navbar will be a list of links going between our pages. We want our navbar component to be rendered on several different pages on our site. Instead of duplicating the code, we can create a component that wraps all children routes. This is called a layout component. To tell the router where to render the child routes, we use the [Outlet] component. Let's create a new NavBar component: #[inline_props]
fn NavBar(cx: Scope) -> Element { render! { nav { ul { li { "links" } } } // The Outlet component will render child routes (In this case just the Home component) inside the Outlet component Outlet::<Route> {} }
} Next, let's add our NavBar component as a layout to our Route enum: #[derive(Routable, Clone)]
#[rustfmt::skip]
enum Route { // All routes under the NavBar layout will be rendered inside of the NavBar Outlet #[layout(NavBar)] #[route("/")] Home {}, #[end_layout] #[route("/:..route")] PageNotFound { route: Vec<String> },
} To add links to our NavBar, we could always use an HTML anchor element but that has two issues: It causes a full-page reload We can accidentally link to a page that doesn't exist Instead, we want to use the Link component provided by Dioxus Router. The Link is similar to a regular <a> tag. It takes a target and children. Unlike a regular <a> tag, we can pass in our Route enum as the target. Because we annotated our routes with the [route(path)] attribute, the Link will know how to generate the correct URL. If we use the Route enum, the rust compiler will prevent us from linking to a page that doesn't exist. Let's add our links: #[inline_props]
fn NavBar(cx: Scope) -> Element { render! { nav { ul { li { Link { // The Link component will navigate to the route specified // in the target prop which is checked to exist at compile time to: Route::Home {}, "Home" } } } } Outlet::<Route> {} }
} Using this method, the Link component only works for links within our application. To learn more about navigation targets see here . Now you should see a list of links near the top of your page. Click on one and you should seamlessly travel between pages.
